import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import {
  HeaderWrapper,
  Logo,
  HeaderItemBar,
  Headernav,
  HeaderLogin,
  HeaderBtn,
  Stick,
  Wrapper,
  ProfileBtn,
} from "./mainStyle"
import Slider from "react-slick";
import Img1 from "../assets/banner/1.jpg"
import Img2 from "../assets/banner/2.jpg"
import Img3 from "../assets/banner/3.jpg"
import Img4 from "../assets/banner/4.jpg"

const Main = () => {

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  const imgslide = [{
    value:0,
    imgurl: Img2
  },{
    value:1,
    imgurl: Img2
  },{
    value:2,
    imgurl: Img3
  },{
    value:3,
    imgurl: Img4
  }]

  return (
    <>
        <HeaderWrapper>
          <Wrapper>          
          <StyledSlider {...settings}>
           <div>
             <Image src={Img1}></Image>
           </div>
           <div>
             <Image src={Img2}></Image>
           </div>
           <div>
             <Image src={Img3}></Image>
           </div>
          </StyledSlider>
          </Wrapper>
        </HeaderWrapper>
    </>
  );
};

export default Main;


const StyledSlider = styled(Slider)`
  .slick-slide div {
    outline: none;
  }
  ,slick-list {
    widrh:1280px;
    margin: 0 auto;
    height:900px;
  }
`;

const ImageContainer = styled.div`
  margin: 0 auto;
  position: relative;
`;

const Image = styled.img`
  width: 100%;
  height: 100%;
  margin: 0 auto;
`;
